import React from 'react';

function Projects() {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <p>Showcase your projects here with descriptions, technologies used, and links to live demos or GitHub repositories.</p>
    </section>
  );
}

export default Projects;
